import { Bar , Line, Pie } from "react-chartjs-2";
import {Chart as ChartJS} from "chart.js/auto"

const Graph = (props)=>{

    const type= props.data.type;
    if(type === "Bar"){
        return <Bar options={props.options} data={props.data} height="700" width="700"/>
    }else if(type === "Line"){
       return <Line options={props.options} data={props.data} height="700" width="700"/>
    }else{
        return <Pie options={props.options} data={props.data} height="700" width="700"/>    
    }
}

export default Graph;
